import './Resume.css'

function Resume() {
  const navigate = useNavigate();

return(
  <div className="container">
    <h1>Resume</h1>

     <div className="card mb-4">
        <img src="https://i.imgur.com/xK8vp5c.png" className="card-img-top" alt="" />
        <div class="card-body">
          <a href="https://drive.google.com/file/d/1naRsPAbxxvdpd5LVscfqHrpIxuAaKoE4/view?usp=sharing" className="btn btn-primary">Download</a>
        </div>
    </div>
  </div>

)
}

export default Resume;
